$(document).ready(function(){$.getJSON("../data.json",function(a){output_html="";$.each(a,function(b,c){output_html+="<tr>";$.each(c,function(d,e){if(d=="url"){url=e}else{if(d=="title"){output_html+='<td><a href="'+url+'">';output_html+=e;output_html+="</a></td>"}else{output_html+="<td>"+e[0]+"</td>"}}});output_html+="</tr>"});$("tbody").append(output_html);$("#command-table").dataTable({order:[[1,"desc"]],iDisplayLength:25})})});